			shellPath = /bin/sh;
			shellScript = "#!/bin/bash\n######################\n\n######################\nWORKSPACE_TARGET=\"MoviesWorkSpace\"\n\necho \"build config====${CONFIGURATION}\"\nSDK_TAR=\"MovieSDK\"\nSDK_TARGET=\"MovieSDK\"\n\n#Script for Debug and release binary\n\nif [ \"${CONFIGURATION}\" = \"Debug\" ] ; then\necho \"===Generating Framework for Debug puprose with ===> ${CONFIGURATION} ====>\"\nREVEAL_ARCHIVE_IN_FINDER=false\n#get simulator path\nSDK_SIMULATOR_LIBRARY_PATH=\"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${SDK_TARGET}.framework\"\necho \"TARGET_NAME==${SDK_TAR}\"\n\n#get Iphobe path\nSDK_DEVICE_LIBRARY_PATH=\"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${SDK_TARGET}.framework\"\necho \"deviepath==${SDK_DEVICE_LIBRARY_PATH}\"\n\n#get Universal path\nUNIVERSAL_LIBRARY_DIR=\"${BUILD_DIR}/${CONFIGURATION}-iphoneuniversal\"\n\nSDK_UNIVERSALFRAMEWORK_PATH=\"${UNIVERSAL_LIBRARY_DIR}/${SDK_TARGET}.framework\"\n######################\n# Build Frameworks\n######################\n\necho \"====BUILD FRAMEWORKS=====\"\n\ncurrentWorkSpaceDir=`echo \"${SRCROOT}\" | sed -e \"s/\\/[^\\/]*$//\"`\n\n#Change directory to main workspace to run commands\ncd ${currentWorkSpaceDir}\necho \"<====BUILD FRAMEWORKS FOR TARGET ==> SDK_TAR == >${CONFIGURATION} =====>\"\n\nxcodebuild -workspace ${WORKSPACE_TARGET}.xcworkspace -scheme ${SDK_TAR} -sdk iphonesimulator -configuration ${CONFIGURATION} -UseModernBuildSystem=NO clean build CONFIGURATION_BUILD_DIR=${BUILD_DIR}/${CONFIGURATION}-iphonesimulator 2>&1\n\nxcodebuild -workspace ${WORKSPACE_TARGET}.xcworkspace -scheme ${SDK_TAR} -sdk iphoneos -configuration ${CONFIGURATION} -UseModernBuildSystem=NO clean build CONFIGURATION_BUILD_DIR=${BUILD_DIR}/${CONFIGURATION}-iphoneos 2>&1\n######################\n# Create directory for universal\n######################\n\nrm -rf \"${UNIVERSAL_LIBRARY_DIR}\"\n\nmkdir \"${UNIVERSAL_LIBRARY_DIR}\"\n\n\n########################################\n# Copy Framework to Universal Framework\n#######################################\n\n\ncp -r \"${SDK_SIMULATOR_LIBRARY_PATH}/.\" \"${SDK_UNIVERSALFRAMEWORK_PATH}\"\n\n######################\n# Make an universal binary\n######################\n\nlipo \"${SDK_DEVICE_LIBRARY_PATH}/${SDK_TARGET}\" \"${SDK_UNIVERSALFRAMEWORK_PATH}/${SDK_TARGET}\" -create -output \"${SDK_UNIVERSALFRAMEWORK_PATH}/${SDK_TARGET}\" | echo\n\n######################\n# COPY  universal binary to Demo Application Folder for reference\n######################\n\necho \"Workspace = ${currentWorkSpaceDir}\"\n\n#FRAMEWORK_COPY_PATH=\"${currentWorkSpaceDir}/Application/Framework\"\nFRAMEWORK_COPY_PATH=\"${currentWorkSpaceDir}/DemoApp/IPhoneOSFramework\"\n\nrm -rf \"${FRAMEWORK_COPY_PATH}\"\nmkdir -p \"${FRAMEWORK_COPY_PATH}\"\n\n#Copy Universal framwork path\ncp -r \"${SDK_UNIVERSALFRAMEWORK_PATH}\" \"${FRAMEWORK_COPY_PATH}\"\n\n#=========End=============\n\nelse\necho \"===Generating for Release =====\"\nREVEAL_ARCHIVE_IN_FINDER=false\n#getDevice path\nSDK_DEVICE_LIBRARY_PATH=\"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${SDK_TARGET}.framework\"\necho \"deviepath==${SDK_DEVICE_LIBRARY_PATH}\"\n######################\n# Build Frameworks\n######################\n\necho \"====BUILD FRAMEWORKS=====\"\n\ncurrentWorkSpaceDir=`echo \"${SRCROOT}\" | sed -e \"s/\\/[^\\/]*$//\"`\n\n#Change directory to main workspace to run commands\ncd ${currentWorkSpaceDir}\nxcodebuild -workspace ${WORKSPACE_TARGET}.xcworkspace -scheme ${SDK_TAR} -sdk iphoneos -configuration ${CONFIGURATION} -UseModernBuildSystem=NO clean build CONFIGURATION_BUILD_DIR=${BUILD_DIR}/${CONFIGURATION}-iphoneos 2>&1\n######################\n# Create directory for universal\n######################\n#iPhoneOSFrameWorkPath\nIPHONEOS_FRAMEWORK_COPY_PATH=\"${currentWorkSpaceDir}/DemoApp/IPhoneOSFramework\"\n#iPhoneOSOnly\nrm -rf \"${IPHONEOS_FRAMEWORK_COPY_PATH}\"\n\nmkdir -p \"${IPHONEOS_FRAMEWORK_COPY_PATH}\"\n#use below code for release version\ncp -r \"${SDK_DEVICE_LIBRARY_PATH}\" \"${IPHONEOS_FRAMEWORK_COPY_PATH}\"\nfi\n\n\n\n";
